import React, { Component } from "react";
import { render } from 'react-dom';
import { WOW } from 'wowjs/dist/wow';
import { Row, Col, Container, Image, rounded, fluid, ListGroup, ListGroupItem, horizontal } from "react-bootstrap";

class ContactPage extends Component {
  componentDidMount() {
    new WOW().init()
  }

  render() {
    return (
      <div className="container">
        <Container className="wow fadeInDown" id="companyOverview">
          <Row>
            <Col sm={12}>
              <h3><strong>CONTACT US</strong></h3>
            </Col>
          </Row>
        </Container>
        <Container>
          <Row sm={3}>
            <h5><strong>North America</strong></h5>
          </Row>
          <Row>
            <p><strong>Connecticut, Maine, Massachusetts, New Hampshire, Rohde Island, Vermont</strong></p>
          </Row>
          <Row>
            <p><strong><a href="http://www.rfassociates-ne.com/index.html" target="blank">RF Associates, Inc.</a></strong></p>
          </Row>
          <Row>430 Boston Street, Suite #206</Row>
          <Row>Topsfield, MA 01983</Row>

        </Container>
      </div>
    )
  }
};

export default ContactPage;
